import React, { Component } from "react";
//import pages for router
import {
    BrowserRouter as Router,
    Route,
    Switch,
    Link,
    Redirect
} from "react-router-dom";

//pages
import Homepage from "./pages/Homepage";


class App extends Component {
    render() {
        return (
            <Router>
                {/*router paths*/}
                <Route path="/" component={Homepage}/>
            </Router>

  );
};
}

export default App;
